import React, { useEffect, useState } from 'react';
import axios from 'axios';

const VisualizationContainer = () => {
  const [points, setPoints] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState('');
  const [scale, setScale] = useState(60);
  const [colour, setColour] = useState("#002fa7");
  const [xAxis, setXAxis] = useState(0);
  const [yAxis, setYAxis] = useState(0);
  const [zAxis, setZAxis] = useState(0);

  const width = 500;
  const height = 500;

  useEffect(() => {
    axios
      .get('http://localhost:8000/points')
      .then((response) => {
        setPoints(response.data.points);
        // setXAxis(response.data.axis.x);
        // setYAxis(response.data.axis.y);
        // setZAxis(response.data.axis.z);
        setLoading(false);
      })
      .catch((error) => {
        console.error('Error fetching points:', error);
        setError('Failed to fetch points');
        setLoading(false);
      });
  }, []);

  const handleClick = (e) => {
    if (points.length > 0) {
      const typeOfRot = e.target.value;
      axios
        .post('http://localhost:8000/rotate_points', {
          type: typeOfRot,
          newPoints: points,
        })
        .then((response) => {
          if (response.status === 200) {
            setPoints(response.data.rotatedPoints);
          } else {
            throw new Error('Failed to rotate points!');
          }
        })
        .catch((error) => {
          console.error('Error:', error);
        });
    }
  };

  const handleAxesRot = (e) => {
    const typeOfRot = e.target.value;
    axios
      .post('http://localhost:8000/rotate_axes', {
        type: typeOfRot,
        axis: [xAxis, yAxis, zAxis],
      })
      .then((response) => {
        if (response.status === 200) {
          const { x, y, z } = response.data.rotatedAxis;
          setXAxis(x);
          setYAxis(y);
          setZAxis(z);
        } else {
          throw new Error('Failed to rotate axes!');
        }
      })
      .catch((error) => {
        console.error('Error rotating axes:', error);
      });
  };

  const projectPoint = (x, y, z) => {
    const cameraPos = 500;
    const projectedX = (x * scale * cameraPos) / (z * scale + cameraPos) + width / 2;
    const projectedY = (-y * scale * cameraPos) / (z * scale + cameraPos) + height / 2;
    return [projectedX, projectedY];
  };

  if (loading) return <p>Loading...</p>;
  if (error) return <p>{error}</p>;

  return (
    <div style={{ overflow: 'hidden' }}>
      <h1>Visualization</h1>
      <div id="svg-wrapper">
        <svg
          width={width}
          height={height}
          style={{ border: '1px solid black' }}
        >
          {/* Render Points */}
          {points.map((point, i) => {
            const [x, y, z] = point;
            const [projectedX, projectedY] = projectPoint(x, y, z);
            return (
              <circle
                key={i}
                cx={projectedX}
                cy={projectedY}
                r={3} // Fixed radius for visibility
                fill={colour}
              />
            );
          })}

          {/* Render Axes */}
          {[
            { axis: 'X', start: [-1, 0, 0], end: [1, 0, 0] },
            { axis: 'Y', start: [0, -1, 0], end: [0, 1, 0] },
            { axis: 'Z', start: [0, 0, -1], end: [0, 0, 1] },
          ].map(({ axis, start, end }, i) => {
            const [startX, startY] = projectPoint(...start.map((val, idx) => val + [xAxis, yAxis, zAxis][idx]));
            const [endX, endY] = projectPoint(...end.map((val, idx) => val + [xAxis, yAxis, zAxis][idx]));
            return (
              <line
                key={i}
                x1={startX}
                y1={startY}
                x2={endX}
                y2={endY}
                stroke={axis === 'Z' ? 'blue' : axis === 'X' ? 'red' : 'green'}
                strokeWidth={2}
              />
            );
          })}
        </svg>
      </div>

      {/* Control Buttons */}
      <button value="x" onClick={handleClick}>
        Rotate Points X
      </button>
      <button value="x" onClick={handleAxesRot}>
        Rotate Axes X
      </button>
      <button value="y" onClick={handleClick}>
        Rotate Points Y
      </button>
      <button value="y" onClick={handleAxesRot}>
        Rotate Axes Y
      </button>
      <button value="z" onClick={handleClick}>
        Rotate Points Z
      </button>
      <button value="z" onClick={handleAxesRot}>
        Rotate Axes Z
      </button>
    </div>
  );
};

export default VisualizationContainer;
